typeql:
match
$u1 isa user, has handle "sarahp.bsky.social";
$rel isa interacted (source_user: $u1, target_user: $u2);
reduce $count = count($rel) groupby $u2;
sort $count desc;
limit 3;
fetch { "interactedUser": $u2.handle, "interactionCount": $count };

match
$u isa user, has x_coordinate $x;
$x > 10000.0;
sort $x;
limit 3;
fetch {
  "handle": $u.handle,
  "x_coordinate": $x
};

match
$u1 isa user;
$rel isa interacted (source_user: $u1, target_user: $u2);
$rel has interaction_key "specific_key";
reduce $interactions = count($rel) groupby $u1;
sort $interactions desc;
limit 5;
fetch {
  "User": $u1.handle,
  "interactions": $interactions
};

match
$u isa user, has color "#3CB371", has size $s;
sort $s desc;
limit 3;
fetch {
  "label": $u.handle,
  "size": $s
};

match
$u1 isa user;
$u2 isa user, has color "#FF4500";
$rel isa interacted (source_user: $u1, target_user: $u2);
reduce $count = count($rel) groupby $u1;
sort $count desc;
limit 5;
fetch {
  "label": $u1.handle,
  "interactions": $count
};

match
$u1 isa user;
$u2 isa user;
$rel isa interacted (source_user: $u1, target_user: $u2), has weight $w;
sort $w desc;
limit 5;
fetch {
  "User1": $u1.handle,
  "User2": $u2.handle,
  "InteractionWeight": $w
};

match
$u1 isa user;
$rel isa interacted (source_user: $u1, target_user: $u2);
$rel has weight $w;
$w > 5.0;
reduce $count = count($rel) groupby $u1;
sort $count desc;
limit 5;
fetch {
  "User": $u1.handle,
  "interactionCount": $count
};

match
$u isa user, has handle $h, has area $a;
sort $a asc;
limit 5;
fetch {
  "label": $h,
  "area": $a
};

match
$u1 isa user;
$u2 isa user, has y_coordinate $y;
$y > 10000.0;
interacted (source_user: $u1, target_user: $u2);
select $u1;
distinct;
limit 3;
fetch {
  "label": $u1.handle
};

match
$u isa user;
$v isa user, has size $s;
$s > 2.0;
interacted (source_user: $u, target_user: $v);
select $u, $v;
distinct;
reduce $count = count($v) groupby $u;
sort $count desc;
limit 5;
fetch {
  "user": $u.handle,
  "interactionCount": $count
};

match
$u isa user, has handle $h, has size $s;
$h like ".*bsky.social.*";
sort $s desc;
limit 3;
fetch {
  "handle": $u.handle,
  "user_key": $u.user_key,
  "size": $u.size
};

match
$u isa user, has color "#4A708B", has size $s;
