match
$target isa user, has handle "sarahgerrard.me";
interacted (source_user: $u, target_user: $target);
$u isa user;
limit 5;
fetch { "label": $u.handle };

match
$u1 isa user;
$u2 isa user;
$r isa interacted (source_user: $u1, target_user: $u2);
$r has size $s;
$s == 0.2;
limit 5;
fetch {
  "u1_handle": $u1.handle,
  "u2_handle": $u2.handle
};

match
$u isa user, has handle "dwither.bsky.social";
interacted (source_user: $u, target_user: $other);
$other isa user;
limit 5;
fetch {
  "user": $other.handle
};

match
$u isa user, has handle $h, has size $s;
sort $s desc;
limit 5;
fetch {
  "handle": $h,
  "size": $s
};

match
$u isa user, has y_coordinate $y;
sort $y asc;
limit 5;
fetch {
  "label": $u.handle,
  "y": $y
};

match
$u isa user, has handle $h, has area $a;
$h like ".*social.*";
$a > 2.0;
sort $a desc;
limit 5;
fetch {
  "label": $h,
  "area": $a
};

match
$u1 isa user;
$u2 isa user, has y_coordinate $y;
$y < -5000.0;
interacted (source_user: $u1, target_user: $u2);
limit 3;
fetch {
  "label": $u1.handle
};

match
$r isa interacted (source_user: $u1, target_user: $u2);
$r has og_weight $w;
$w == 1;
$u1 has handle $h1;
$u2 has handle $h2;
limit 5;
fetch {
  "User1": $h1,
  "User2": $h2,
  "ogWeight": $w
};

match
$u1 isa user;
$u2 isa user, has color "#FF4500";
$rel isa interacted (source_user: $u1, target_user: $u2);
reduce $count = count($rel) groupby $u1;
sort $count desc;
limit 5;
fetch { "handle": $u1.handle, "interactions": $count };

match
$u isa user, has area $a;
sort $a desc;
limit 3;
fetch {
  "handle": $u.handle,
  "area": $a
};

match
$u1 isa user, has x_coordinate $x, has y_coordinate $y;
$u2 isa user, has size $s;
$s < 2.0;
interacted (source_user: $u1, target_user: $u2);
reduce $avg_x = mean($x), $avg_y = mean($y);

match
$u1 isa user;
$rel isa interacted (source_user: $u1, target_user: $u2);
reduce $interactions = count($rel) groupby $u1;
sort $interactions desc;
limit 3;
fetch { "User": $u1.handle, "interactions": $interactions };

match
$u1 isa user, has area $a1;
$u2 isa user, has area $a2;
$a1 > 3.0;
$a2 > 3.0;
$r isa interacted (source_user: $u1, target_user: $u2);
fetch {
  "User1": $u1.handle,
  "User2": $u2.handle,
  "weight": $r.weight,
  "ogWeight": $r.og_weight,
  "size": $r.size,
  "key": $r.interaction_key
};

match
$u isa user;
interacted (source_user: $u, target_user: $other);
$other isa user;
select $u, $other;
distinct;
reduce $count = count($other) groupby $u;
match
$count > 3;
$u has handle $h;
fetch {
  "userLabel": $h,
  "interactionCount": $count
};

match
$u1 isa user, has handle $h1;
$u2 isa user, has handle $h2;
$r isa interacted (source_user: $u1, target_user: $u2), has og_weight $w;
sort $w desc;
limit 3;
fetch {
  "User1": $h1,
  "User2": $h2,
  "ogWeight": $w
};

match
$u1 isa user;
$rel isa interacted (source_user: $u1, target_user: $u2);
$rel has weight $w;
reduce $total = sum($w) groupby $u1;
sort $total desc;
limit 3;
fetch { "user": $u1.handle, "total_interactions": $total };

match
  $u isa user, has handle "chromevoid.bsky.social";
  interacted (source_user: $u, target_user: $other);
  $other isa user;
limit 3;
fetch {
  "label": $other.handle
};

match
$u isa user, has size $s;
$s < 2.0;
sort $s desc;
limit 5;
fetch {
  "handle": $u.handle,
  "size": $s
};

match
$u isa user, has y_coordinate $y;
$y < -5000.0;
sort $y;
limit 3;
fetch {
  "label": $u.handle,
  "y": $y
};

match
$u isa user, has area $a, has handle $h;
$a > 5.0;
limit 3;
fetch {
  "label": $h,
  "area": $a
};

match
$u isa user, has x_coordinate $x;
sort $x desc;
limit 3;
fetch {
  "key": $u.user_key
};

match
$u isa user, has area $a;
sort $a asc;
limit 5;
fetch {
  "handle": $u.handle,
  "area": $a
};

match
$u isa user, has color "#3CB371";
limit 3;
fetch {
  "label": $u.handle
};

match
$u isa user, has size $s;
sort $s desc;
limit 3;
fetch {
  "handle": $u.handle,
  "size": $s
};

match
$u isa user, has y_coordinate $y;
sort $y asc;
limit 5;
fetch {
  "label": $u.handle,
  "y": $y
};

match
$u isa user, has handle $h, has x_coordinate $x;
sort $x asc;
limit 3;
fetch {
  "label": $h,
  "x": $x
};

match
$u isa user, has area $a;
sort $a desc;
limit 5;
fetch {
  "label": $u.handle
};

match
$u1 isa user, has color "#3CB371", has handle $h1;
$u2 isa user, has color "#FF0000", has handle $h2;
interacted (source_user: $u1, target_user: $u2);
fetch {
  "GreenUser": $h1,
  "RedUser": $h2
};

match
$u1 isa user;
$u2 isa user, has area 4.94;
interacted (source_user: $u1, target_user: $u2);
select $u1;
distinct;
fetch {
  "InteractingUsers": $u1.handle
};

match
$u1 isa user;
$u2 isa user, has x_coordinate $x;
$x < -10000.0;
interacted (source_user: $u1, target_user: $u2);
fetch {
  "InteractingUser": $u1.handle
};

match
  $u1 isa user, has handle "sarahgerrard.me";
  $u2 isa user, has color "#7EC0EE";
  interacted (source_user: $u1, target_user: $u2);
limit 3;
fetch {
  "label": $u2.handle
};

match
$u isa user;
$rel isa interacted (source_user: $u, target_user: $u2);
reduce $count = count($rel) groupby $u;
match $count > 5;
match
$rel2 isa interacted (source_user: $u, target_user: $u3);
$rel2 has weight $w;
reduce $avg_weight = mean($w) groupby $u;
fetch { "avgWeight": $avg_weight };

match
$u1 isa user;
$u2 isa user, has y_coordinate $y;
interacted (source_user: $u1, target_user: $u2);
$y > 10000.0;
select $u1;
distinct;
fetch {
  "handle": $u1.handle
};

match
$u1 isa user, has handle $h1;
$u2 isa user, has handle $h2;
$h1 like ".*bsky.*";
$h2 like ".*dev.*";
interacted (source_user: $u1, target_user: $u2);
fetch {
  "handle": $u1.handle,
  "user_key": $u1.user_key
};

match
$u1 isa user, has color $c;
interacted (source_user: $u1, target_user: $u2);
select $c;
distinct;
fetch { "unique_colors": $c };

match
$u isa user, has size $s;
not { interacted (source_user: $u, target_user: $other); $other isa user; };
sort $s desc;
limit 3;
fetch {
  "handle": $u.handle,
  "size": $s
};

match
$u1 isa user, has handle $h1, has size $s1;
$h1 like ".*social.*";
$s1 > 1.5;
$u2 isa user, has handle $h2, has size $s2;
$h2 like ".*social.*";
$s2 > 1.5;
$r isa interacted (source_user: $u1, target_user: $u2);
$r has weight $w, has og_weight $ow, has size $rs, has interaction_key $ik;
fetch {
  "User1": $h1,
  "User2": $h2,
  "InteractionWeight": $w,
  "OriginalWeight": $ow,
  "InteractionSize": $rs,
  "InteractionKey": $ik
};

match
$u isa user, has handle $h, has area $a;
interacted (source_user: $u);
select $u, $h, $a;
distinct;
sort $a desc;
limit 5;
fetch {
  "UserLabel": $h,
  "Area": $a
};

match
$u1 isa user, has handle $h1, has area $a1;
$u2 isa user, has handle $h2, has area $a2;
interacted (source_user: $u1, target_user: $u2);
let $diff = abs($a1 - $a2);
sort $diff desc;
limit 5;
fetch {
  "User1": $h1,
  "User2": $h2,
  "areaDifference": $diff
};

match
$u1 isa user, has x_coordinate $x;
interacted (source_user: $u1);
select $u1, $x;
distinct;
sort $x desc;
limit 3;
fetch { "User": $u1.handle, "X_Coordinate": $x };

match
$u1 isa user, has handle $h1;
$h1 like "^r.*";
$u2 isa user, has size $s2;
$s2 > 2.0;
$rel isa interacted (source_user: $u1, target_user: $u2), has weight $w;
$u2 has handle $h2;
fetch {
  "User1": $h1,
  "User2": $h2,
  "InteractionWeight": $w
};

match
$u1 isa user, has handle "dwither.bsky.social";
interacted (source_user: $u1, target_user: $u2);
$u2 has size 3.25;
fetch {
  "user": { $u2.* }
};

match
$u1 isa user, has handle $h;
$u2 isa user, has y_coordinate $y;
$y < -5000.0;
interacted (source_user: $u1, target_user: $u2);
select $h;
distinct;
fetch {
  "InteractingUsers": $h
};

match
$u1 isa user, has handle $h1;
$u2 isa user, has handle "vtcodes.dev";
$rel isa interacted (source_user: $u1, target_user: $u2), has interaction_key "geid_68_0";
fetch {
  "interacting_users": $h1
};

match
$u1 isa user;
$u2 isa user, has color "#0000FF";
interacted (source_user: $u1, target_user: $u2);
select $u1;
distinct;
fetch {
  "label": $u1.handle
};

match
$u isa user, has y_coordinate $y;
$y > 5000.0;
interacted (source_user: $u, target_user: $other);
$other isa user;
reduce $interactions = count($other) groupby $u, $y;
match
$interactions >= 2;
fetch {
  "handle": $u.handle,
  "y_coordinate": $y,
  "interactions": $interactions
};
